import React from "react";

function Soda() {
  return (
    <div>
      <h1>SO REFRESHING</h1>
      <img
        src="https://i.giphy.com/DbD6EnlEQmjTi.gif"
        alt="Diet coke exploding everywhere."
      />
    </div>
  );
}

export default Soda;
